## I18n Violations in a Library Platform

### 1. Hardcoded Text in JavaScript

**Violation:**
```javascript
function displayBookDetails(book) {
  alert(`You have borrowed the book: ${book.title}`);
}
```

**Explanation:** The text "You have borrowed the book:" is hardcoded in English. This makes it difficult to translate the application into other languages.

**Inconsistent File Structure Issue:** The text is scattered throughout the JavaScript files, making it hard to manage and update translations.

### 2. Using `toUpperCase()` and `toLowerCase()` for Localization

**Violation:**
```javascript
function searchBooks(query) {
  const normalizedQuery = query.toLowerCase();
  // Perform search using normalizedQuery
}
```

**Explanation:** Not all languages have the same capitalization rules as English. Using `toLowerCase()` may lead to incorrect search results in languages like Turkish, where "i" can be written as "İ" or "ı".

### 3. Date and Time Formatting

**Violation:**
```javascript
function displayDueDate(dueDate) {
  return `Due on: ${dueDate.toLocaleDateString()}`;
}
```

**Explanation:** The date format may not be understood by users in other cultures. For example, in the US, the date is typically written as MM/DD/YYYY, while in Europe, it's DD/MM/YYYY.

